import React from "react";
import { NavLink } from "react-router-dom";
import Nav from "../nav/Nav";
import mc from "./header.module.scss";
import logo from "../../assets/img/logo.png";

const Header = () => {
  return (
    <header>
      <div className="container">
        <h1>
          <NavLink to="/"></NavLink>
        </h1>
        <Nav />
      </div>
    </header>
  );
};

export default Header;
